import React, { useState } from 'react';
import { View, Text } from 'react-native';

const Matrix = () => {
  const [matrix, setMatrix] = useState([
    [0, 0, 0],
    [0, 0, 0],
    [0, 0, 0]
  ]);

  return (
    <View>
      {matrix.map((row, rowIndex) => (
        <View key={rowIndex}>
          {row.map((cell, cellIndex) => (
            <Text key={cellIndex}>{cell}</Text>
          ))}
        </View>
      ))}
    </View>
  );
};

export default Matrix;
